      "about-us-content": "Scudetto is a hand manufacture creating unique vests that can be not only an\n                            addition to an elegant suit but also a key part of your wardrobe in the casual                        \n                            moments of your life. Using high quality fabrics, we give you a small shield,\n                            from the Italian Scudetto, so you will never run out of style and elegance.\n                            Taking advantage of patterns from the early 20th century, we introduce vests\n                            to 21st century street fashion. The frivolity of the present and advanced\n                            technologies give us the opportunity to connect these two worlds. You can\n                            choose whether you want to order a ready-made vest or create a unique\n                            completely personalized one. We leave this choice to you giving you tools.",
