      "terms-contact-2": " or phone\n                        (Monday to Friday from 9{00} AM to 4{00} PM) Piotr: 788863434, Mariusz:\n                        600372555. We prefer email contact, but if you want to listen to our voices :),\n                        or if its more convenient for you - dont hesitate to call.",
      "terms-time": "Vest completion time and shipping. Our vests are custom made - also those\n                        visible on pictures at our online store. Looking for materials we always chose\n                        and buy a small amount of it so that each vest can be unique. We are\n                        definitely against mass production. The maximum order processing time is 21\n                        days, but we do our very best so that the vest you have chosen will reach you\n                        faster. The carefully packed vest will be delivered by courier service, of what\n                        you will be immediately informed by email.",
      "terms-refunds": "Zwroty. Kamizelki stworzone w naszym KREATORZE s personalizowane czyli szyte s na zamwienie. Wszystkie s nowe, dokadnie opisujemy ich skad i sposb pielgnacji. Prosimy wic by dobrze przemyle swj wybr i kilka razy zerkn do naszej tabeli rozmiarw. Przyjmujemy tylko zwroty w ramach reklamacji, ale takie si jeszcze nie zdarzyy, a my dokadamy stara by nie zdarzyy si nigdy. Gdyby jednak co poszo nie tak honorowo zwrcimy pienidze lub poprawimy/uszyjemy now kamizelk. Kada kamizelka jest szyta z pasj i dokadnie sprawdzana przed wysyk. Jak zoy reklamacj? Celem rozpatrzenia reklamacji Towaru, Klient powinien przesa lub dostarczy reklamowany Towar, doczajc do niego dowd zakupu. Towar naley dostarczy lub przesa na adres Scudetto S.C. ul. Kasztanowa 7a 32-005 Niepoomice. Na rozpatrzenie reklamacji mamy 14 dni. Kamizelki ze SKLEPU klient jako konsument moe - bez uzasadnienia - zwrci - zachowujc 14 dniowy termin od chwili dostarczenia przesyki. Po wysaniu owiadczenia o zwrocie towaru nie pniej ni w do 14 dni wysyamy klientowi zwrot nalenoci za dan kamizelk. Klient ponosi jedynie koszt zwrotu towaru. Dokonujemy zwrotu patnoci przy uyciu takiego samego sposobu zapaty, jakiego uy konsument, chyba, e konsument wyrazi zgod na inny sposb zwrotu, przy czym sposb ten nie bdzie si wiza dla konsumenta z adnym kosztem. Moemy wstrzyma si ze zwrotem patnoci otrzymanych od Klienta do chwili otrzymania rzeczy z powrotem lub dostarczenia przez Klienta dowodu jej odesania, w zalenoci od tego, ktre zdarzenie nastpi wczeniej.",
